The stack overflow is not only related to assignment expressions, but also to the recursive descent in parsing primary, unary, postfix, and new expressions. The codebase uses `CHECK_RECURSION` in some parsing functions (e.g., `parsePrimaryExpression`, `parseUnaryExpression`, `parseNewExpressionOrOptionalExpression`), but not in all recursive/chainable parsing entry points.

**Key findings:**
- The iterative stack limit for assignment expressions is not enough, as other recursive parsing functions (e.g., `parsePrimaryExpression`, `parseUnaryExpression`, `parseNewExpressionOrOptionalExpression`, etc.) can still cause stack overflows.
- The macro `CHECK_RECURSION` is used in some, but not all, recursive parsing functions.
- The sanitizer stack trace shows deep recursion through these parsing functions.

**Patch plan:**
- Add `CHECK_RECURSION;` at the start of all recursive parsing entry points that can be called in a chain, especially:
  - `parseOptionalExpressionExceptNew`
  - `parseNewExpressionOrOptionalExpression`
  - `parseLeftHandSideExpression`
  - `parsePostfixExpression`
- This will ensure that the parser's recursion depth is checked and an error is raised before stack exhaustion.

Let's generate the patch.
```diff
--- a/lib/Parser/JSParserImpl.cpp
+++ b/lib/Parser/JSParserImpl.cpp
@@ -3143,6 +3143,8 @@
 Optional<ESTree::Node *> JSParserImpl::parseOptionalExpressionExceptNew(
     IsConstructorCall isConstructorCall) {
+  CHECK_RECURSION;
+
   SMLoc startLoc = tok_->getStartLoc();

   ESTree::NodePtr expr;
@@ -3625,6 +3627,8 @@
 Optional<ESTree::Node *> JSParserImpl::parseNewExpressionOrOptionalExpression(
     IsConstructorCall isConstructorCall) {
+  CHECK_RECURSION;
+
   if (!check(TokenKind::rw_new))
     return parseOptionalExpressionExceptNew(isConstructorCall);

@@ -3720,6 +3724,8 @@
 Optional<ESTree::Node *> JSParserImpl::parseLeftHandSideExpression() {
+  CHECK_RECURSION;
+
   SMLoc startLoc = tok_->getStartLoc();

   auto optExpr = parseNewExpressionOrOptionalExpression(IsConstructorCall::No);
@@ -3774,6 +3780,8 @@
 Optional<ESTree::Node *> JSParserImpl::parsePostfixExpression() {
+  CHECK_RECURSION;
+
   SMLoc startLoc = tok_->getStartLoc();
   auto optLHandExpr = parseLeftHandSideExpression();
   if (!optLHandExpr)
     return None;
```
